import React from "react";
import NavbarProducer from "../../components/navbar/NavbarProducer";
import JobOpportunity from "../../components/jobsProducer/JobOpportunity";
import FilterProducer from "../../components/jobsProducer/FilterProducer";
import styles from './Dashboard.module.css'
import { useState } from "react";

const DashboardProducer = () => {
  const [seen, setSeen] = useState(false)

  function togglePop () {
    setSeen(!seen);
};
  return (
    <>
      <NavbarProducer/>
      <div className={styles.dashpro}>
       <h1>My Jobs</h1>
      </div>
    </>
    
  );
};
export default DashboardProducer ;


function App() {

  

  return (
      <div>
          <button onClick={togglePop}>Login</button>
          {seen ? <Login toggle={togglePop} /> : null}
      </div>
  )
}
